import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
var timeAndDate = () => {
  const date = new Date();
  return `${date.getDate()}/${date.getMonth()}/${date.getFullYear()} || ${date.getHours()}:${date.getMinutes()}:${date.getSeconds()}`;
};
var taskArr = [
  {
    taskName: "Task_001",
    taskTime: timeAndDate(),
  },
  {
    taskName: "Task_002",
    taskTime: timeAndDate(),
  },
];

function Output() {
  return (
    <div>
      <Events />
    </div>
  );
}
function Events() {
  return (
    <task>
      <taskName>{taskArr[0].taskName}</taskName>
      <taskTime>{taskArr[0].taskTime}</taskTime>
    </task>
  );
}
ReactDOM.render(<Output />, document.getElementById("root"));
